import React from "react";
import { ReactComponent as LOGO } from "../../1-atoms/Icons/ClarioLogo.svg";
import classnames from "classnames";

const Footer: React.FC<React.AllHTMLAttributes<HTMLDivElement>> = ({
  ...props
}) => {
  return (
    <footer
      {...props}
      className={classnames(
        "bg-white pt-[40px] pb-[20px] px-[24px]",
        props.className
      )}
    >
      <LOGO />
      <p
        className={
          "text-center font-normal text-base leading-[20px] text-luckyPoint tracking-[-0.248889px]"
        }
      >
        © 2023 Clario Tech DMCC All rights reserved.
      </p>
    </footer>
  );
};

export default Footer;
